import React, { useEffect, useState } from "react";
import { useSpring, animated } from "react-spring";
import { BsPersonCircle } from "react-icons/bs";
import { Link as ScrollLink } from "react-scroll";
import { useLocation, useNavigate } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";
import "../style/owl.carousel.css";
import "../style/owl.theme.default.min.css";
import "../style/bootstrap.min.css";

const NavbarComponent = () => {
  const user = sessionStorage.getItem("user");
  const userString = user ? JSON.parse(user) : null;
  const [scrollY, setScrollY] = useState(0);
  const location = useLocation();
  const [activeMenuItem, setActiveMenuItem] = useState(location.hash);
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const navigate = useNavigate();

  const handleMenuClick = (menuItem) => {
    setActiveMenuItem(menuItem);
    if (location.pathname !== "/") {
      navigate(menuItem);
    }
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const navbarStyles = useSpring({
    opacity: scrollY > 50 ? 0.8 : 1,
    background: scrollY > 100 ? "#000000" : "#15D4EE",
  });

  const navLinkStyles = useSpring({
    opacity: 1,
    transform: "translateX(0)",
    from: { opacity: 0, transform: "translateX(-20px)" },
  });

  return (
    <animated.header
      style={{
        ...navbarStyles,
        position: "fixed",
        width: "100%",
        zIndex: 1000,
      }}
      className="site-navbar py-4 js-sticky-header site-navbar-target"
      role="banner"
    >
      <div className="container-fluid">
        <div className="d-flex align-items-center">
          <div className="site-logo mr-auto w-25">
            <a href="/">Makseb Solutions</a>
          </div>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <ScrollLink
                to="home-section"
                href="/#home-section"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
                className={`nav-link ${
                  activeMenuItem === "/#home-section" ? "Nav-Active" : ""
                }`}
                onClick={() => handleMenuClick("/#home-section")}
              >
                Accueil
              </ScrollLink>
              <ScrollLink
                to="Categories-section"
                href="/#Categories-section"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
                className={`nav-link ${
                  activeMenuItem === "/#Categories-section" ? "Nav-Active" : ""
                }`}
                onClick={() => handleMenuClick("/#Categories-section")}
              >
                Catégories
              </ScrollLink>
              <ScrollLink
                to="Tutorial-section"
                href="/#Tutorial-section"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
                className={`nav-link ${
                  activeMenuItem === "/#Tutorial-section" ? "Nav-Active" : ""
                }`}
                onClick={() => handleMenuClick("/#Tutorial-section")}
              >
                Tutorial
              </ScrollLink>
              <Nav.Link href="/Profil">
                <BsPersonCircle />
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
          <div className="mx-auto text-center">
            <div className="mobile-menu-icon" onClick={toggleMobileMenu}>
              ☰
            </div>
            <div className={`navbar-links ${isMobileMenuOpen ? "active" : ""}`}>
              <Nav className="ml-auto">
                <animated.li style={navLinkStyles}>
                  <Nav.Link
                    href="/#home-section"
                    className={`nav-link ${
                      activeMenuItem === "Accueil" ? "Active" : ""
                    }`}
                    onClick={() => handleMenuClick("Accueil")}
                  >
                    Accueil
                  </Nav.Link>
                </animated.li>
                <animated.li style={navLinkStyles}>
                  <Nav.Link
                    href="/#Categories-section"
                    className={`nav-link ${
                      activeMenuItem === "Catégories" ? "Active" : ""
                    }`}
                    onClick={() => handleMenuClick("Catégories")}
                  >
                    Catégories
                  </Nav.Link>
                </animated.li>
                <animated.li style={navLinkStyles}>
                  <Nav.Link
                    href="/#Tutorial-section"
                    className={`nav-link ${
                      activeMenuItem === "Tutorial" ? "Active" : ""
                    }`}
                    onClick={() => handleMenuClick("Tutorial")}
                  >
                    Tutorial
                  </Nav.Link>
                </animated.li>
                {userString && (
                  <animated.li style={navLinkStyles}>
                    <Nav.Link
                      href="/Profil"
                      className={`nav-link ${
                        activeMenuItem === "Profil" ? "Active" : ""
                      }`}
                      onClick={() => handleMenuClick("Profil")}
                    >
                      Profil
                    </Nav.Link>
                  </animated.li>
                )}
              </Nav>
            </div>
          </div>
        </div>
      </div>
    </animated.header>
  );
};

export default NavbarComponent;
